$(document).ready(function(){var NAVBAR_SCROLL_LIMIT=55;$('html').offset().top>NAVBAR_SCROLL_LIMIT?navbarStatic():navbarBlend();$(window).scroll(function(){$(this).scrollTop()>NAVBAR_SCROLL_LIMIT?navbarStatic():navbarBlend()});$('a').on('click',function(event){if(this.hash!==""){event.preventDefault();var hash=this.hash;$('html, body').animate({scrollTop:$(hash).offset().top-50},800)}});$('.slider-nav').slick({arrows:!1,centerMode:!0,autoplay:!0,autoplaySpeed:5000,lazyLoad:'ondemand',mobileFirst:!0,responsive:[{breakpoint:2200,settings:{arrows:!0,slidesToShow:5,}},{breakpoint:1024,settings:{arrows:!0,slidesToShow:3,}},{breakpoint:991,settings:{arrows:!0}},{breakpoint:768,settings:{slidesToShow:1,}}]});$('.slider-nav a').simpleLightbox({showCounter:!1,});$('.footer .sponsor a').on({'mouseenter':function(){$(this).find('.logo-placeholder').addClass('hover')},'mouseleave':function(){$(this).find('.logo-placeholder').removeClass('hover')}})});function navbarStatic(){$('.navbar-view-blend').addClass('navbar-view-static');$('.navbar-view-blend').removeClass('navbar-view-blend')}
function navbarBlend(){$('.navbar-view-static').addClass('navbar-view-blend');$('.navbar-view-static').removeClass('navbar-view-static')}
